from redis_client.redis import redis_clientfrom stores.Auchan.auchan_model import AuchanStorefrom tasks.client import celery_app#@celery_app.taskdef start_auchan():    auchan = AuchanStore()    items = auchan.generate_info()    result = auchan.compare_data_auchan(items)    data = redis_client.transfer_to_json(result)    redis_client.save_data_in_redis(name='auchan', value=data)    return result